lies from many people, and we immediately started working on this.</p><p>Today, we are happy to say that we can offer our clients a stable way to import content between WPML-driven websites. We worked closely with the <a\nhref="http://www.wpallimport.com/" target="_blank">WP All Import development team</a> and rewrote the <a\nhref="https://wpml.org/ru/account/downloads/">WPML All Import add-on</a>.</p><p>You can read the full tutorial and start importing your multilingual websites here &#8211; <a\nhref="https://wpml.org/documentation/related-projects/wpml-all-import-plugin-website-import-with-wpml/">WPML All Import &#8211; Website import with WPML</a>.</p> <div class="feedflare">\n<a href="http://feeds.feedburner.com/~ff/wpml?a=5aPJCCMnZ40:xtShsAlHtK4:D7DqB2pKExk"><img src="http://feeds.feedburner.com/~ff/wpml?i=5aPJCCMnZ40:xtShsAlHtK4:D7DqB2pKExk" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/wpml?a=5aPJCCMnZ40:xtShsAlHtK4:gIN9vFwOqvQ"><img src="http://feeds.feedburner.com/~ff/wpml?i=5aPJCCMnZ40:xtShsAlHtK4:gIN9vFwOqvQ" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/wpml?a=5aPJCCMnZ40:xtShsAlHtK4:V_sGLiPBpWU"><img src="http://feeds.feedburner.com/~ff/wpml?i=5aPJCCMnZ40:xtShsAlHtK4:V_sGLiPBpWU" border="0"></img></a>\n</div><img src="http://feeds.feedburner.com/~r/wpml/~4/5aPJCCMnZ40" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:54:"https://wpml.org/2015/10/wpml-all-import-is-here/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"2";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:42:"http://rssnamespace.org/feedburner/ext/1.0";a:1:{s:8:"origLink";a:1:{i:0;a:5:{s:4:"d