}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:4:"Amit";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:4743:"<p><a\nhref="https://wordpress.org/plugins/woocommerce-multilingual/" title="WooCommerce Multilingual" target="_blank">WooCommerce Multilingual</a> is a very important project for us, today we are happy to announce that we have 4 WooCommerce Extensions to add to our compatibility list.</p><p>The extensions are <a\ntitle="PayPal Advanced" href="http://www.woothemes.com/products/paypal-advanced/">PayPal Advanced</a>, <a\ntitle="WooCommerce Local Pickup Plus" href="https://yithemes.com/themes/plugins/yith-woocommerce-quick-view/">WooCommerce Quick View</a>, <a\ntitle="YITH WooCommerce Zoom Magnifier" href="https://yithemes.com/themes/plugins/yith-woocommerce-zoom-magnifier/">YITH WooCommerce Zoom Magnifier</a>, <a\ntitle="WooCommerce Kesher HK" href="http://www.10bit.co.il/product/woocommerce-gateway-kesherhk">WooCommerce Kesher HK</a></p><p>If you want to review the entire multilingual ready list of themes and plugins you are welcome to view it here:</p><ul><li><a\ntitle="Multilingual Ready Themes " href="https://wpml.org/documentation/theme-compatibility/">Multilingual Ready Themes</a></li><li><a\ntitle="Multilingual Ready Plugins " href="https://wpml.org/documentation/plugins-compatibility/">Multilingual Ready Plugins</a></li></ul><p>Also, if you&#8217;re a theme or a plugin author and you want to make it compatible with WPML, we welcome you and ready to help: You are welcome to contact us at <a\nhref="https://wpml.org/documentation/theme-compatibility/go-global-program/">go global program page</a>.</p><p>In order to expedite the process we strongly recommend that you test your theme or plugin with our <a\ntitle="Achieving WPML compatibility for your themes and plugins" href="https://wpml.org/documentation/support/achieving-wpml-compatibility-for-your-themes-and-plugins/">Achieving WPML compatibility for your themes and plugins</a>. It easily tests compatibility with WPML and helps you quickly make your theme or plugin <strong>Multilingual Ready</strong>.</p><div\nclass="feature"><h2 style="text-align: center">PayPal Advanced</h2><p\nstyle="text-align: center"><a\nhref="http://www.woothemes.com/products/paypal-advanced/"></a></p><blockquote><p>Take credit card payments securely via Paypal Payments Advanced (Payflow) keeping customers on your site.</p></blockquote><p\nstyle="text-align: center"><a\nclass="button download-button vt-p" href="http://www.woothemes.com/products/paypal-advanced/">Purchase PayPal Advanced</a></p></div><div\nclass="feature"><h2 style="text-align: center">YITH WooCommerce Quick View</h2><p\nstyle="text-align: center"><a\nhref="https://yithemes.com/themes/plugins/yith-woocommerce-quick-view/"></a></p><blockquote><p>Adds the possibility to see immediately product details and magnified images of them makes users feel more comfortable with the website they are browsing and makes them also more willing to buy.</p></blockquote><p\nstyle="text-align: center"><a\nclass="button download-button vt-p" href="https://yithemes.com/themes/plugins/yith-woocommerce-quick-view/" target="_blank">Purchase YITH WooCommerce Quick View</a></p></div><div\nclass="feature"><h2 style="text-align: center">YITH WooCommerce Zoom Magnifier</h2><p\nstyle="text-align: center"><a\nhref="https://yithemes.com/themes/plugins/yith-woocommerce-zoom-magnifier/"></a></p><blockquote><p>Adds a zoom affect for products images</p></blockquote><p\nstyle="text-align: center"><a\nclass="button download-button vt-p" href="https://yithemes.com/themes/plugins/yith-woocommerce-zoom-magnifier/">Purchase YITH WooCommerce Zoom Magnifier</a></p></div><div\nclass="feature"><h2 style="text-align: center">WooCommerce Kesher HK Payment Gateway</h2><p\nstyle="text-align: center"><a\nhref="http://www.10bit.co.il/product/woocommerce-gateway-kesherhk"></a></p><blockquote><p>This plugin allows you to set the Kesher HK gateway</p></blockquote><p\nstyle="text-align: center"><a\nclass="button download-button vt-p" href="http://www.10bit.co.il/product/woocommerce-gateway-kesherhk">Purchase WooCommerce Kesher HK Payment Gateway</a></p></div> <div class="feedflare">\n<a href="http://feeds.feedburner.com/~ff/wpml?a=DW89n47ItB0:MMAUaT_6MdE:D7DqB2pKExk"><img src="http://feeds.feedburner.com/~ff/wpml?i=DW89n47ItB0:MMAUaT_6MdE:D7DqB2pKExk" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/wpml?a=DW89n47ItB0:MMAUaT_6MdE:gIN9vFwOqvQ"><img src="http://feeds.feedburner.com/~ff/wpml?i=DW89n47ItB0:MMAUaT_6MdE:gIN9vFwOqvQ" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/wpml?a=DW89n47ItB0:MMAUaT_6MdE:V_sGLiPBpWU"><img src="http://feeds.feedburner.com/~ff/wpml?i=DW89n47ItB0:MMAUaT_6MdE:V_sGLiPBpWU" border="0"></img></a>\n</div><img src="http://feeds.feedburner.com/~r/wpml/~4/DW89n47ItB0" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:144:"https://wpml.org/2015/10/woocommerce-compatibility-paypal-advanced-woocommerce-quick-view-woocommerce-zoom-magnifier-woocommerce-kesher-hk/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"0";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:42:"http://rssnamespace.org/feedburner/ext/1.0";a:1:{s:8:"origLink";a:1:{i:0;a:5:{s:4:"data";s:139:"https://wpml.org/2015/10/woocommerce-compatibility-paypal-advanced-woocommerce-quick-view-woocommerce-zoom-magnifier-woocommerce-kesher-hk/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:3;a:6:{s:4:"data";s:9:"         ";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:6:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:99:"Can a tourist’s village in Greece build a professional-looking multilingual site on a shoestring?";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:51:"http://feedproxy.google.com/~r/wpml/~3/ZZab5m9MorQ/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:130:"https://wpml.org/2015/10/can-a-tourists-village-in-greece-build-a-professional-looking-multilingual-site-on-a-shoestring/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 15 Oct 2015 14:33:36 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:1:{i:0;a:5:{s:4:"data";s:12:"Case studies";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:26:"https://wpml.org/?p=725425";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:350:"Many residents of the Greek village of Mirtos live off tourism. For Mirtos, effective advertising can make the difference between prosperity and financial trouble. They set out to develop a website that would attract tourists from all over Europe. The website needed to look professional, be easy to maintain, and run in five languages. The [&#8230;]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:7:"peter.m";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:9100:"<p>Many residents of the Greek village of Mirtos live off tourism. For Mirtos, effective advertising can make the difference between prosperity and financial trouble. They set out to develop a website that would attract tourists from all over Europe. The website needed to look professional, be easy to maintain, and run in five languages. The challenge was to build such a site on a small budget and use volunteers for much of the work. Did the Mirtoseans succeed?</p><p>Jurrie Eilers, a web developer, accepted the challenge of building Mirtos’ website. Since 2006, Jurrie has been working exclusively with WordPress. Hence, WordPress was the obvious choice for this project. Next, Jurrie had to come up with a design and figure out how to make the site multilingual. Fortunately, Jurrie found that the Divi theme and WPML work smoothly together. This made Jurrie’s life easier because of the flexibility that Divi offers and the complete translation workflow in WPML.</p><div\nid="attachment_725468" style="width: 753px" class="wp-caption alignnone"><a\nhref="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/10/image001.jpg"><img\nclass="size-full wp-image-725468" src="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/10/image001.jpg" alt="" width="743" height="544" /></a><p\nclass="wp-caption-text"><a\nhref="http://www.mirtoscrete.gr/">http://www.mirtoscrete.gr/</a></p></div><p>The combination of WordPress, Divi, and WPML gave Jurrie and the people of Mirtos everything they needed, and on a small budget. Designing the site took little effort: the people themselves could manage the content and handle all translation work. By using local translators from Mirtos, the site enjoys accurate multilingual content, which reads naturally and is appealing to the tourists.</p><h2>Smooth Integration Between WordPress, the Theme, and WPML Reduces Costs</h2><p>Remember the tight budget that Mirtos village had for this project? Imagine burning the entire budget on troubleshooting and bug fixes. Surely, this wouldn’t be good for the project. To avoid getting into trouble, Jurrie picked a theme that was already <a\nhref="https://wpml.org/documentation/theme-compatibility/">compatible with WPML</a>, while fulfilling his design and maintenance objectives. This way, Jurrie could spend his time on designing and building the site and not on troubleshooting problems.</p><p><strong>“I used the Divi theme from Elegant Themes. It has got a great Page Builder, is highly customizable, and has a Module Library. This is very useful for multilingual sites and saves a lot of time. In particular, the Global Module function comes in handy: changing one element will synchronize the change in all five languages.”</strong></p><p>Starting the project on the right path is the most important thing we can do to get us to our destination.</p><h2>WPML’s Translation Management Enables Community Translation</h2><p>Content is king, and that is certainly true for the translated content. The people of Mirtos understood that irrespective of the tools you use, if you use low-quality content, the results will be poor.</p><p><a\nhref="https://wpml.org/documentation/translating-your-contents/using-the-translation-editor/">WPML’s Translation Management</a> module makes it easy for content managers and translators to work together. The site’s admin sets up “translator” users having very specific capabilities to translate. Translators do not need to worry about the site’s structure, links, or other HTML issues. The content manager chooses what content to translate and into which language. Translators receive notification emails, and  they work using WPML’s dedicated Translation Editor. When translations are complete, WPML puts back everything together and adjusts the links and menus.</p><p><strong>“All of the content was translated by real people, who are well educated in at least two of the languages. My own native language is Dutch, but I wrote the website first in English, and had it corrected by an English professor, Christine Anderson. I did the Dutch translation, and then the German translation was done by my wife, who is from Austria and speaks German, Greek, Dutch, and English very well.”</strong></p><p>This way, teams of non-technical people can maintain high quality translation in WordPress.</p><h2>Caching Drastically Improves Page-Load Performance</h2><p><a\nhref="http://www.mirtoscrete.gr/">Mirtoscrete.gr</a> uses advanced tools that can potentially cause slow loading of front-end content. Jurrie’s decision of using an advanced theme with a page builder makes editing and maintaining content very convenient. Instead of paying for this convenience with performance, mirtoscrete.gr uses advanced caching. 99% of the traffic to the site is by “visitors” (not logged-in users). This means that page caching handles the majority of the loading and makes pages load quickly.</p><p>The site uses two plug-ins for the job. <a\nhref="http://wp-rocket.me/">WP Rocket</a> caches pages and skips the entire PHP processing for visitors. <a\nhref="https://wordpress.org/plugins/wp-optimize/">WP-Optimize</a> keeps the database clean and lean, and avoids bloat from building up.</p><h2>Mini-Sites Give Business their Own Space</h2><p>The “Cafes and Restaurants” pages use a blank template, which has no menu or footer. This allows authors to turn simple pages into their own mini-sites. By removing the standard page elements, authors of these pages can brand their pages as they wish, and make them look like individual mini-sites.</p><p>This is another idea to reduce costs and simplify the workflow. Instead of creating completely separate WordPress sites, Jurrie created a site that business users can use as their own. These mini-sites can also be multilingual because WPML is already running.</p><div\nid="attachment_725471" style="width: 1181px" class="wp-caption alignnone"><a\nhref="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/10/image003.png"><img\nclass="size-full wp-image-725471" src="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/10/image003.png" alt="" width="1171" height="949" /></a><p\nclass="wp-caption-text">Mini-Sites Give Business their Own Space</p></div><h2>Content and Room for Improvement</h2><p><a\nhref="http://www.mirtoscrete.gr/">Mirtoscrete.gr</a> acts as a portal, connecting visitors to all of the site’s content. Jurrie dedicated himself to visiting all of the accommodations and restaurants personally. This effort paid off. The site’s content is written in a personal voice and shows great care.</p><p>All of the content in the site was created using simple WordPress pages with the Divi builder. Jurrie says that this works but is not ideal, as content maintenance can be difficult. Vast structural changes would require editing the entire site.</p><div\nid="attachment_725472" style="width: 1034px" class="wp-caption alignnone"><a\nhref="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/10/image005.jpg"><img\nclass="size-large wp-image-725472" src="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/10/image005-1024x386.jpg" alt="" width="1024" height="386" /></a><p\nclass="wp-caption-text">content block setup</p></div><p><strong>“It took way too long for the page to load, with every accommodation having its own custom background, a gallery, sometimes with dozens of pictures, and some of them including a Facebook feed or a YouTube embed. I therefore, decided to split it into three pages containing eight accommodations each, which I already regret. I should have given each item its own page.”</strong></p><h2>Conclusions</h2><p>Mirtos’ website shows that it is possible to create a great-looking multilingual site even without a big budget. Good planning and selection of the correct tools enabled this to happen.. Choosing WordPress, a good theme, WPML, and good caching made it all possible. Jurrie and the translation team could focus their entire time on creating the site, writing content, and translating. They avoided expensive custom development and troubleshooting and saved themselves a great deal of trouble and cost.</p><p>Most importantly, the site fulfills its purpose. <a\nhref="http://www.mirtoscrete.gr/">Mirtoscrete.gr</a> attracts visitors from different countries and helps local businesses to evolve.</p> <div class="feedflare">\n<a href="http://feeds.feedburner.com/~ff/wpml?a=ZZab5m9MorQ:y8w3eBUXMIA:D7DqB2pKExk"><img src="http://feeds.feedburner.com/~ff/wpml?i=ZZab5m9MorQ:y8w3eBUXMIA:D7DqB2pKExk" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/wpml?a=ZZab5m9MorQ:y8w3eBUXMIA:gIN9vFwOqvQ"><img src="http://feeds.feedburner.com/~ff/wpml?i=ZZab5m9MorQ:y8w3eBUXMIA:gIN9vFwOqvQ" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/wpml?a=ZZab5m9MorQ:y8w3eBUXMIA:V_sGLiPBpWU"><img src="http://feeds.feedburner.com/~ff/wpml?i=ZZab5m9MorQ:y8w3eBUXMIA:V_sGLiPBpWU" border="0"></img></a>\n</div><img src="http://feeds.feedburner.com/~r/wpml/~4/ZZab5m9MorQ" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:126:"https://wpml.org/2015/10/can-a-tourists-village-in-greece-build-a-professional-looking-multilingual-site-on-a-shoestring/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"0";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:42: