ultilingual Ready [&#8230;]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:4:"Amit";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:4923:"<p>Today we are happy to announce that we have 2 themes and 2 plugins to add to our compatibility list. The themes are <a\ntitle="Game" href="https://www.gavick.com/wordpress-themes/game">Game</a>, <a\ntitle="Amax" href="http://themeforest.net/item/amax-responsive-multipurpose-wordpress-theme/11458572?ref=mopc76">Amax</a>, and the plugins are <a\ntitle="WP Store Locator" href="https://wordpress.org/plugins/wp-store-locator/">WP Store Locator</a>, <a\ntitle="Social Deals" href="https://wordpress.org/plugins/deals-engine/">Social Deals</a></p><p>If you want to review the entire multilingual ready list of themes and plugins you are welcome to view it here:</p><ul><li><a\ntitle="Multilingual Ready Themes " href="https://wpml.org/documentation/theme-compatibility/">Multilingual Ready Themes</a></li><li><a\ntitle="Multilingual Ready Plugins " href="https://wpml.org/documentation/plugins-compatibility/">Multilingual Ready Plugins</a></li></ul><p>Also, if you&#8217;re a theme or a plugin author and you want to make it compatible with WPML, we welcome you and ready to help: You are welcome to contact us at <a\nhref="https://wpml.org/documentation/theme-compatibility/go-global-program/">go global program page</a>.</p><p>In order to expedite the process we strongly recommend that you test your theme or plugin with our <a\ntitle="Achieving WPML compatibility for your themes and plugins" href="https://wpml.org/documentation/support/achieving-wpml-compatibility-for-your-themes-and-plugins/">Achieving WPML compatibility for your themes and plugins</a>. It easily tests compatibility with WPML and helps you quickly make your theme or plugin <strong>Multilingual Ready</strong>.</p><div\nclass="feature"><h2 style="text-align: center;">Game theme</h2><p\nstyle="text-align: center;"><a\nhref="https://www.gavick.com/wordpress-themes/game"><img\nclass="aligncenter size-full wp-image-340493" src="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/10/game.png" alt="ekho" width="590" height="300" /></a></p><blockquote><p>A true next-gen premium WordPress theme for the modern world. Take it to the next level with Game theme. Gamers want functionality and usability, but still appreciate a bit of eye-candy.</p></blockquote><p><a\nclass="button download-button vt-p" href="https://www.gavick.com/wordpress-themes/game" target="_blank">Purchase Game theme</a></p></div><div\nclass="feature"><h2 style="text-align: center;">Amax theme</h2><p\nstyle="text-align: center;"><a\nhref="http://themeforest.net/item/amax-responsive-multipurpose-wordpress-theme/11458572?ref=mopc76"><img\nsrc="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/10/amax.png" alt="ekho" width="590" height="300" /></a></p><blockquote><p>Responsive Multi-Purpose WordPress Theme</p></blockquote><p><a\nclass="button download-button vt-p" href="http://themeforest.net/item/amax-responsive-multipurpose-wordpress-theme/11458572?ref=mopc76">Purchase Amax theme</a></p></div><div\nclass="feature"><h2 style="text-align: center;">WP Store Locator Plugin</h2><p\nstyle="text-align: center;"><a\nhref="https://wordpress.org/plugins/wp-store-locator/"><img\nclass="aligncenter size-full wp-image-340493" src="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/10/wpstore.png" alt="ekho" width="590" height="300" /></a></p><blockquote><p>WP Store Locator is a powerful and easy to use location management system.</p></blockquote><p><a\nclass="button download-button vt-p" href="https://wordpress.org/plugins/wp-store-locator/">Download WP Store Locator plugin</a></p></div><div\nclass="feature"><h2 style="text-align: center;">Social Deals Plugin</h2><p\nstyle="text-align: center;"><a\nhref="https://wordpress.org/plugins/deals-engine/"><img\nclass="aligncenter size-full wp-image-340493" src="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/10/social.png" alt="ekho" width="590" height="300" /></a></p><blockquote><p>An Extendable Plugin built to allow you to use Special Offers and Deals through the Power of Scarcity, Limited Quantity, Exclusivity, and Price Manipulation.</p></blockquote><p><a\nclass="button download-button vt-p" href="https://wordpress.org/plugins/deals-engine/">Download Social Deals plugin</a></p></div> <div class="feedflare">\n<a href="http://feeds.feedburner.com/~ff/wpml?a=sp4l5R5sEJk:10EQCvyP3Qg:D7DqB2pKExk"><img src="http://feeds.feedburner.com/~ff/wpml?i=sp4l5R5sEJk:10EQCvyP3Qg:D7DqB2pKExk" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/wpml?a=sp4l5R5sEJk:10EQCvyP3Qg:gIN9vFwOqvQ"><img src="http://feeds.feedburner.com/~ff/wpml?i=sp4l5R5sEJk:10EQCvyP3Qg:gIN9vFwOqvQ" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/wpml?a=sp4l5R5sEJk:10EQCvyP3Qg:V_sGLiPBpWU"><img src="http://feeds.feedburner.com/~ff/wpml?i=sp4l5R5sEJk:10EQCvyP3Qg:V_sGLiPBpWU" border="0"></img></a>\n</div><img src="http://feeds.feedburner.com/~r/wpml/~4/sp4l5R5sEJk" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:91:"https://wpml.org/2015/10/this-week-compatible-game-amax-wp-store-locator-social-deals/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"0";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:42:"http://rssnamespace.org/feedburner/ext/1.0";a:1