0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:4:"Amit";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:1660:"<p>A few weeks ago we asked you to <a\nhref="https://wpml.org/2015/08/help-us-know-which-import-plugin-you-use-for-wpml/">help us with importing WordPress Multilingual sites</a>, after that we went on and worked on a solution and now you can already use our new add-on &#8216;WPML All Import&#8217;, which is available on your WPML account Downloads section.</p><p>Now we&#8217;d like to resolve the other side of that function &#8211; we are looking for solutions you are using when exporting WordPress Multilingual sites, again we know many of our clients are using different solutions, probably a very popular scenario is the export / import of a multilingual shop where you also have all kinds of products with their taxonomies that needs to be exported. If you used an exporting tool that worked for you please leave a comment here below.</p><p>If you are an author of an export WordPress plugin drop us a line too and we’ll start working together.</p> <div class="feedflare">\n<a href="http://feeds.feedburner.com/~ff/wpml?a=43UzUlDasGk:kQry8NBVD6E:D7DqB2pKExk"><img src="http://feeds.feedburner.com/~ff/wpml?i=43UzUlDasGk:kQry8NBVD6E:D7DqB2pKExk" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/wpml?a=43UzUlDasGk:kQry8NBVD6E:gIN9vFwOqvQ"><img src="http://feeds.feedburner.com/~ff/wpml?i=43UzUlDasGk:kQry8NBVD6E:gIN9vFwOqvQ" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/wpml?a=43UzUlDasGk:kQry8NBVD6E:V_sGLiPBpWU"><img src="http://feeds.feedburner.com/~ff/wpml?i=43UzUlDasGk:kQry8NBVD6E:V_sGLiPBpWU" border="0"></img></a>\n</div><img src="http://feeds.feedburner.com/~r/wpml/~4/43UzUlDasGk" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:80:"https://wpml.org/2015/10/help-us-know-which-export-plugin-you-use-for-wpml/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"9";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:42:"http://rssnamespace.org/feedburner/ext/1.0";a:1:{s:8:"origLink";a:1:{i:0;a:5:{s:4:"data";s:75:"https://wpml.org/2015/10/help-us-know-which-export-plugin-you-use-for-wpml/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:6;a:6:{s:4:"data";s:9:"         ";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:6:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:81:"This week compatible – Vacation Rental, Weblizar, Real Estate 6, Shiroi, Bridge";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:51:"http://feedproxy.google.com/~r/wpml/~3/U6N0iZivUoU/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:108:"https://wpml.org/2015/10/this-week-compatible-vacation-rental-weblizar-real-estate-6-shiroi-bridge/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 08 Oct 2015 13:39:16 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:1:{i:0;a:5:{s:4:"data";s:22:"Compatibility Bulletin";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:2