s</a></li></ul><p>Also, if you&#8217;re a theme or a plugin author and you want to make it compatible with WPML, we welcome you and ready to help: You are welcome to contact us at <a\nhref="https://wpml.org/documentation/theme-compatibility/go-global-program/">go global program page</a>.</p><p>In order to expedite the process we strongly recommend that you test your theme or plugin with our <a\ntitle="Achieving WPML compatibility for your themes and plugins" href="https://wpml.org/documentation/support/achieving-wpml-compatibility-for-your-themes-and-plugins/">Achieving WPML compatibility for your themes and plugins</a>. It easily tests compatibility with WPML and helps you quickly make your theme or plugin <strong>Multilingual Ready</strong>.</p><div\nclass="feature"><h2 style="text-align: center;">Vacation Rental theme</h2><p\nstyle="text-align: center;"><a\nhref="http://templatic.com/app-themes/vacation-rental"><img\nclass="aligncenter size-full wp-image-340493" src="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/10/vacation.png" alt="ekho" width="590" height="300" /></a></p><blockquote><p>Vacation Rental is a advanced booking theme with the ability to manage multiple properties.</p></blockquote><p><a\nclass="button download-button vt-p" href="http://templatic.com/app-themes/vacation-rental" target="_blank">Purchase Vacation Rental theme</a></p></div><div\nclass="feature"><h2 style="text-align: center;">Weblizar theme</h2><p\nstyle="text-align: center;"><a\nhref="https://weblizar.com/themes/weblizar-premium-theme/"><img\nsrc="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/10/weblizar.png" alt="ekho" width="590" height="300" /></a></p><blockquote><p>A simple lightweight and responsive WordPress theme designed for Business and Corporates in mind.</p></blockquote><p><a\nclass="button download-button vt-p" href="https://weblizar.com/themes/weblizar-premium-theme/">Purchase Weblizar theme</a></p></div><div\nclass="feature"><h2 style="text-align: center;">Real Estate 6 theme</h2><p\nstyle="text-align: center;"><a\nhref="http://themeforest.net/item/wp-pro-real-estate-6-responsive-wordpress-theme/6648339"><img\nclass="aligncenter size-full wp-image-340493" src="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/10/realestate.png" alt="ekho" width="590" height="300" /></a></p><blockquote><p>A powerful, super flexible responsive real estate theme.</p></blockquote><p><a\nclass="button download-button vt-p" href="http://themeforest.net/item/wp-pro-real-estate-6-responsive-wordpress-theme/6648339">Purchase Real Estate 6 theme</a></div><div\nclass="feature"><h2 style="text-align: center;">Shiroi theme</h2><p\nstyle="text-align: center;"><a\nhref="http://themeforest.net/item/shiroi-hana-an-elegant-blogging-theme/9722726"><img\nclass="aligncenter size-full wp-image-340493" src="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/10/shiroi.png" alt="ekho" width="590" height="300" /></a></p><blockquote><p>Shiroi Hana is lightweight, multi-purpose WordPress theme suitable for magazine.</p></blockquote><p><a\nclass="button download-button vt-p" href="http://themeforest.net/item/shiroi-hana-an-elegant-blogging-theme/9722726">Purchase Shiroi theme</a></div><div\nclass="feature"><h2 style="text-align: center;">Bridge theme</h2><p\nstyle="text-align: center;"><a\nhref="http://themeforest.net/item/bridge-creative-multipurpose-wordpress-theme/7315054"><img\nclass="aligncenter size-full wp-image-340493" src="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/10/bridge.png" alt="ekho" width="590" height="300" /></a></p><blockquote><p>One of the TOP selling theme on ThemeForest, comes with 124 ready to use demo sites.</p></blockquote><p><a\nclass="button download-button vt-p" href="http://themeforest.net/item/bridge-creative-multipurpose-wordpress-theme/7315054">Purchase Bridge theme</a></div> <div class="feedflare">\n<a href="http://feeds.feedburner.com/~ff/wpml?a=U6N0iZivUoU:lurODr75OR4:D7DqB2pKExk"><img src="http://feeds.feedburner.com/~ff/wpml?i=U6N0iZivUoU:lurODr75OR4:D7DqB2pKExk" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/wpml?a=U6N0iZivUoU:lurODr75OR4:gIN9vFwOqvQ"><img src="http://feeds.feedburner.com/~ff/wpml?i=U6N0iZivUoU:lurODr75OR4:gIN9vFwOqvQ" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/wpml?a=U6N0iZivUoU:lurODr75OR4:V_sGLiPBpWU"><img src="http://feeds.feedburner.com/~ff/wpml?i=U6N0iZivUoU:lurODr75OR4:V_sGLiPBpWU" border="0"></img></a>\n</div><img src="http://feeds.feedburner.com/~r/wpml/~4/U6N0iZivUoU" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:104:"https://wpml.org/2015/10/this-week-compatible-vacation-rental-weblizar-real-estate-6-shiroi-bridge/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"0";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:42:"http://rssnamespace.org/feedburner/ext/1.0";a:1:{s:8:"origLink";a:1:{i:0;a:5:{s:4:"data";s:99:"https://wpml.org/2015/10/this-week-compatible-vacation-rental-weblizar-real-estate-6-shiroi-bridge/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:7;a:6:{s:4:"data";s:9:"         ";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:6:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:47:"WPML Makes it Easy to Run Sites Without English";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:51:"http://feedproxy.google.com/~r/wpml/~3/-NugxQFJ00g/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:82:"https://wpml.org/2015/10/wpml-makes-it-easy-to-run-sites-without-english/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 08 Oct 2015 11:23:13 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:1:{i:0;a:5:{s:4:"data";s:13:"WPML versions";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:26:"https://wpml.org/?p=719277";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:390:"The vast majority of WordPress sites today are non-English sites. Today, WPML makes it easier to run multilingual sites, which don&#8217;t have English as their default language, or don&#8217;t have English at all. Why English &#160;is&#160; was a special language in your multilingual sites? WPML&#8217;s String Translation gets texts from different sources. Most importantly, it [&#8230;]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:4:"Amir";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:10128:"<p><strong>The vast majority of WordPress sites today are non-English sites. Today, WPML makes it easier to run multilingual sites, which don&#8217;t have English as their default language, or don&#8217;t have English at all.</strong></p><h2>Why English <del>&nbsp;is&nbsp;</del> was a special language in your multilingual sites?</h2><p>WPML&#8217;s String Translation gets texts from different sources. Most importantly, it get strings from GetText functions (WordPress, the theme and plugins) and from texts that you enter in different places in the WordPress admin.</p><p>Almost everything that comes from GetText will be originally in English. You want to enter texts in the WordPress admin in the site&#8217;s default language.</p><p>The problem, until now, was that the String Translation had only ONE source language setting. Then, we even removed that because setting it to not English created mountains of problems.</p><p>Now, source language for strings is making a big comeback. Each string has its own source language and you can easily set the language of individual strings, or entire contexts.</p><p>Let&#8217;s look at a practical example. Supposing that your site runs in Spanish (default), Catalan and French. No English. Your theme and plugins are coded with English, as their original language.</p><p>In this example, you will want to translate the texts in the theme from English to Spanish, Catalan and French. You will want to enter the site&#8217;s tagline and widgets in Spanish and translate them to Catalan and French. You certainly don&#8217;t want to go through English.</p><table\nstyle="width:70%;"><tr><th\nstyle="width:50%;">Enter texts in your normal language</th><th\nstyle="width:50%;">Translate to the site&#8217;s other languages in String Translation</th></tr><tr><td><div\nid="attachment_720357" style="width: 160px" class="wp-caption alignnone"><a\nhref="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/10/site-name-and-tagline.jpg"><img\nsrc="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/10/site-name-and-tagline-150x48.jpg" width="150" height="48" class="size-thumbnail wp-image-720357" /></a><p\nclass="wp-caption-text">Site name and tagline in Spanish, in the WordPress Settings admin screen</p></div></td><td><div\nid="attachment_720361" style="width: 160px" class="wp-caption alignnone"><a\nhref="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/10/tagline-translation-from-spanish.jpg"><img\nsrc="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/10/tagline-translation-from-spanish-150x102.jpg" width="150" height="102" class="size-thumbnail wp-image-720361" /></a><p\nclass="wp-caption-text">We can translate the tagline from Spanish to the other languages in the site</p></div></td></tr></table><table\nstyle="width:70%;"><tr><th\nstyle="width:50%;">The Spanish homepage (original language)</th><th\nstyle="width:50%;">The French homepage (translation)</th></tr><tr><td><div\nid="attachment_720363" style="width: 160px" class="wp-caption alignnone"><a\nhref="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/10/site-homepage.jpg"><img\nsrc="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/10/site-homepage-150x76.jpg" width="150" height="76" class="size-thumbnail wp-image-720363" /></a><p\nclass="wp-caption-text">&#8216;Original&#8217; Spanish on the homepage</p></div></td><td><div\nid="attachment_720365" style="width: 160px" class="wp-caption alignnone"><a\nhref="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/10/tagline-in-french.jpg"><img\nsrc="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/10/tagline-in-french-150x118.jpg" width="150" height="118" class="size-thumbnail wp-image-720365" /></a><p\nclass="wp-caption-text">French translation on the French homepage</p></div></td></tr></table><p>With this update to WPML, you can do just this. WPML assumes that any texts coming from WordPress, the theme or plugins is in English. Even if your site doesn&#8217;t have English, you will still see English as the source language of these strings and you can translate to all of your site&#8217;s languages.</p><p>WPML will also assume that any texts that you enter in the WordPress admin will be in the site&#8217;s default language. You will be able to translate these texts to the other languages in the site, without going through English.</p><h2>How to set the source languages of strings</h2><p>You can change the languages of specific strings or all strings that belong to a domain.</p><p>To change the language of specific strings, select them and click on the new <strong>Change language of selected strings</strong> button. Then, select the new language.</p><div\nid="attachment_720441" style="width: 310px" class="wp-caption alignnone"><a\nhref="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/10/change-the-language-of-selected-strings.jpg"><img\nsrc="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/10/change-the-language-of-selected-strings-300x148.jpg" width="300" height="148" class="size-medium wp-image-720441" /></a><p\nclass="wp-caption-text">Change the language of selected strings</p></div><p>You can also change the language of entire contexts. This is useful when you get a theme or a plugin, that&#8217;s coded in a language other than English. Click on the new link, at the top of the String Translation page, <strong>Language of domains</strong>.</p><div\nid="attachment_720444" style="width: 310px" class="wp-caption alignnone"><a\nhref="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/10/languages-of-domains.jpg"><img\nsrc="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/10/languages-of-domains-300x242.jpg" width="300" height="242" class="size-medium wp-image-720444" /></a><p\nclass="wp-caption-text">Click on the link to &#8216;Languages of domains&#8217;</p></div><p>Then, choose the new language.</p><div\nid="attachment_720448" style="width: 310px" class="wp-caption alignnone"><a\nhref="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/10/languages-of-domains-dialog.jpg"><img\nsrc="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/10/languages-of-domains-dialog-300x234.jpg" width="300" height="234" class="size-medium wp-image-720448" /></a><p\nclass="wp-caption-text">Dialog for setting the language of entire domains</p></div><p>The dialog will show you a table of the strings in that domain. You can choose the new language and also make it the default language for new strings that will be added to that domain.</p><h2>Existing sites remain unchanged (unless you want to change strings)</h2><p>Existing sites are not affected by this change. Since you HAD to write texts in English before in the WordPress admin, when you update to the new version of WPML, WPML will know that existing admin strings are in English. If you want, you can now change their language and enter them again in your site&#8217;s default language. However, this change is entirely up to you. If you don&#8217;t want to go through the hassle, you don&#8217;t have to.</p><p>To update the string languages of existing sites, follow the same as shown before. You can update individual strings or entire contexts.</p><h2>Known issues</h2><p>This beta version isn&#8217;t yet working completely smoothly with Gravity Forms and with our Layouts plugin (packages translation). There may also be a few minor performance issues.</p><p>Every known issue will be resolved by the time this version goes to production. We recommend to skip your testing now with this beta version and Gravity Forms and Toolset plugins, as we are working on known issues.</p><h2>Download the beta</h2><p><strong>This version of WPML is currently in beta. It&#8217;s been a huge change in WPML core and the String Translation and it&#8217;s not ready for production sites yet.</strong> We are inviting you to try this beta on your development sites. We&#8217;re run a lot of tests, but we can&#8217;t cover all combinations of themes and plugins. Before this version moves to production, we are asking your help to test with your development sites. If you are running a site that has a default language other than English, this update is very much for you. Download the beta and try it.</p><p>To download, go to your <a\nhref="">WPML account</a>. Click on Downloads and scroll all the way to the bottom. Download the <strong>CMS Beta Package</strong>. This ZIP file includes all of WPML&#8217;s components. You need to use the WPML components from this ZIP only and not mix development versions with production versions.</p><p>If you are using WooCommerce Multilingual, use the beta from that package too. The WooCommerce Multilingual beta is updated for this change in string languages.</p><h2>Feedback?</h2><p>With this update to WPML, String Translation should become a lot easier for you. Please tell us about anything that doesn&#8217;t make sense or requires complex setup. We tried to set the best defaults, so that you can just &#8216;translate&#8217;, without having to go through language definitions. If we missed anything, tell us.</p><p>To report problems, best to create a thread in our support forum. You can follow up with a comment here, so that we can see all related threads (and handle them).</p><p><strong>Questions? Suggestions? Ideas? Leave your comments and we&#8217;ll get back to you.</strong></p> <div class="feedflare">\n<a href="http://feeds.feedburner.com/~ff/wpml?a=-NugxQFJ00g:6p1Cn5lZXVI:D7DqB2pKExk"><img src="http://feeds.feedburner.com/~ff/wpml?i=-NugxQFJ00g:6p1Cn5lZXVI:D7DqB2pKExk" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/wpml?a=-NugxQFJ00g:6p1Cn5lZXVI:gIN9vFwOqvQ"><img src="http://feeds.feedburner.com/~ff/wpml?i=-NugxQFJ00g:6p1Cn5lZXVI:gIN9vFwOqvQ" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/wpml?a=-NugxQFJ00g:6p1Cn5lZXVI:V_sGLiPBpWU"><img src="http://feeds.feedburner.com/~ff/wpml?i=-NugxQFJ00g:6p1Cn5lZXVI:V_sGLiPBpWU" border="0"></img></a>\n</div><img src="http://feeds.feedburner.com/~r/wpml/~4/-NugxQFJ00g" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:78:"https://wpml.org/2015/10/wpml-makes-it-easy-to-run-sites-without-english/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:2:"63";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:42:"http://rssnamespace.org/feedburner/ext/1.0";a:1:{s:8:"origLink";a:1:{i:0;a:5:{s:4:"data";s:73:"https://wpml.org/2015/10/wpml-makes-it-easy-to-run-sites-without-english/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:8;a:6:{s:4:"data";s:9:"         ";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:6:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:48:"Migration for ICanLocalize clients to WPML 3.2.x";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:51:"http://feedproxy.google.com/~r/wpml/~3/2NCoI1kH5qg/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:83:"https://wpml.org/2015/09/migration-for-icanlocalize-clients-to-wpml-3-2-x/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Mon, 28 Sep 2015 23:05:48 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:1:{i:0;a:5:{s:4:"data";s:13:"Announcements";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:26:"https://wpml.org/?p=713905";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:378:"Finally, after very long (and complex) development, ICanLocalize clients can upgrade WPML to its current version and continue to enjoy a streamlined translation workflow. What&#8217;s Changed in WPML 3.2? (that took so long) WPML 3.2 includes a complete new interface to translation services. You probably know that now WPML offers more translation options, with great [&#8230;]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:4:"Amir";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:6365:"<p><strong>Finally, after very long (and complex) development, <a\nhref="http://www.icanlocalize.com/site/">ICanLocalize</a> clients can upgrade WPML to its current version and continue to enjoy a streamlined translation workflow.</strong></p><h2>What&#8217;s Changed in WPML 3.2? (that took so long)</h2><p>WPML 3.2 includes a complete new interface to translation services. You probably know that now WPML offers more translation options, with great new translation services coming very soon.</p><p>This update meant that WPML now communicates with translation services using a different method than before. Instead of working directly with ICanLocalize, WPML communicates with what we call &#8220;Translation Proxy&#8221;. This middle server is a huge help, as it allows us to monitor the communication and quickly troubleshoot anything that goes wrong. It also means that translation services don&#8217;t need to directly communicate with individual WordPress sites (which saves a heap of problems with PHP libraries, compatibility, encoding, etc.).</p><p>The problem was, we didn&#8217;t have a way to move existing ICanLocalize projects from the &#8216;old&#8217; way to the new one. Now we do <img\nsrc="https://d2salfytceyqoe.cloudfront.net/wp-includes/images/smilies/simple-smile.png" alt=":-)" class="wp-smiley" style="height: 1em; max-height: 1em;" /></p><h2>How to Update to the Current WPML Version</h2><p>All WPML sites can now move to the current version. If you are using ICanLocalize, you will see a pretty scary message about having to downgrade. This message is from before the time we had this migration plugin.</p><div\nid="attachment_713915" style="width: 310px" class="wp-caption alignnone"><a\nhref="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/09/migration-plugin-needed.png"><img\nsrc="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/09/migration-plugin-needed-300x167.png" alt="Message about incorrect WPML version. Ignore the on-screen instructions." width="300" height="167" class="size-medium wp-image-713915" /></a><p\nclass="wp-caption-text">Message about incorrect WPML version. Ignore the on-screen instructions.</p></div><p>Ignore it. Don&#8217;t downgrade WPML and follow the rest of the instructions here.</p><p>Go to your <a\nhref="https://wpml.org/account/">WPML.org account</a> and click on <strong>Downloads</strong>. Scroll all the way to the bottom and download the plugin called <strong>Migrate ICanLocalize Translation to WPML 3.2</strong>. Install it on your site and activate.</p><p>The scary message about having to downgrade will go away. Now, go to the new menu that the plugin created for the migration process.</p><p>Go to <strong>WPML-&gt;Migrate ICanLocalize Translation to WPML 3.2</strong>.</p><div\nid="attachment_713922" style="width: 310px" class="wp-caption alignnone"><a\nhref="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/09/migration-screen.png"><img\nsrc="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/09/migration-screen-300x115.png" alt="Migration plugin admin screen" width="300" height="115" class="size-medium wp-image-713922" /></a><p\nclass="wp-caption-text">Migration plugin admin screen</p></div><p>You will see two buttons. First, click to migrate the account to WPML 3.2. This runs almost instantly. Then, click to migrate the jobs.</p><p>You should be all set. When you go to WPML-&gt;Translation Management-&gt;Translators, you should see your current ICL translators selected and completed jobs will appear again in WPML&#8217;s Translation Dashboard.</p><div\nid="attachment_713935" style="width: 310px" class="wp-caption alignnone"><a\nhref="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/09/get-completed-translation-larger.png"><img\nsrc="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/09/get-completed-translation-larger-300x140.png" alt="Completed jobs waiting in the Translation Dashboard" width="300" height="140" class="size-medium wp-image-713935" /></a><p\nclass="wp-caption-text">Completed jobs waiting in the Translation Dashboard</p></div><p>If there are any problems in this migration process (there should not be), the migration plugin will report them on the screen. Create a new ticket in <a\nhref="https://wpml.org/forums/forum/english-support/">WPML technical support forum</a>, copy what you see and paste in the forum thread. Be sure to explain what you are doing and what you are seeing.</p><p>You no longer need the migration plugin. Go to <strong>Plugins</strong> and deactivate it. The migration plugin does&#8217;t do anything else. Keeping it active will not cause any problems, but it&#8217;s not needed for your sites.</p><h2>The right order to update WPML and WordPress</h2><p>If you are running an older version of WPML, chances are you are also running an older version of WordPress.</p><p>A safe update process will be:</p><ol><li>Back up your site&#8217;s database</li><li>Update ALL of WPML&#8217;s components to the current version</li><li>Install and run the migration plugin for ICanLocalize clients (obviously, only if you are an ICanLocalize client)</li><li>Update WordPress</li></ol><h2>Automatic Version Update for Everyone</h2><p>This week, we want to see how this migration process goes, so we&#8217;re letting it run on manual mode. We ran comprehensive testing on this process and it&#8217;s already running successfully on all our sites too.</p><p>Next week, we will finally push automated updates for all existing WPML sites to the current version.</p><p><strong>Questions? Suggestions? Ideas? Leave your comments and we&#8217;ll get back to you.</strong></p> <div class="feedflare">\n<a href="http://feeds.feedburner.com/~ff/wpml?a=2NCoI1kH5qg:4pzcjrdXgFs:D7DqB2pKExk"><img src="http://feeds.feedburner.com/~ff/wpml?i=2NCoI1kH5qg:4pzcjrdXgFs:D7DqB2pKExk" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/wpml?a=2NCoI1kH5qg:4pzcjrdXgFs:gIN9vFwOqvQ"><img src="http://feeds.feedburner.com/~ff/wpml?i=2NCoI1kH5qg:4pzcjrdXgFs:gIN9vFwOqvQ" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/wpml?a=2NCoI1kH5qg:4pzcjrdXgFs:V_sGLiPBpWU"><img src="http://feeds.feedburner.com/~ff/wpml?i=2NCoI1kH5qg:4pzcjrdXgFs:V_sGLiPBpWU" border="0"></img></a>\n</div><img src="http://feeds.feedburner.com/~r/wpml/~4/2NCoI1kH5qg" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:79:"https://wpml.org/2015/09/migration-for-icanlocalize-clients-to-wpml-3-2-x/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"5";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:42:"http://rssnamespace.org/feedburner/ext/1.0";a:1:{s:8:"origLink";a:1:{i:0;a:5:{s:4:"data";s:74:"https://wpml.org/2015/09/migration-for-icanlocalize-clients-to-wpml-3-2-x/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:9;a:6:{s:4:"data";s:9:"         ";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:6:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:115:"WooCommerce Compatibility – Simplicity, Local Pickup Plus, YITH Cart Messages, Flat Rate per State/Country/Region";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:51:"http://feedproxy.google.com/~r/wpml/~3/xvt26nJeonY/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:141:"https://wpml.org/2015/09/woocommerce-compatibility-simplicity-local-pickup-plus-yith-cart-messages-flat-rate-per-statecountryregion/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Fri, 25 Sep 2015 08:05:58 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:1:{i:0;a:5:{s:4:"data";s:22:"Compatibility Bulletin";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:26:"https://wpml.org/?p=712035";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:350:"WooCommerce Multilingual is a very important project for us, today we are happy to announce that we have 1 Woo theme and 3 WooCommerce Extensions to add to our compatibility list. The theme is Simplicity, and the extensions are WooCommerce Local Pickup Plus, YITH WooCommerce Cart Messages, Flat Rate per State/Country/Region If you want to [&#8230;]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:4:"Amit";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:4963:"<p><a\nhref="https://wordpress.org/plugins/woocommerce-multilingual/" title="WooCommerce Multilingual" target="_blank">WooCommerce Multilingual</a> is a very important project for us, today we are happy to announce that we have 1 Woo theme and 3 WooCommerce Extensions to add to our compatibility list.</p><p>The theme is <a\ntitle="Simplicity" href="http://www.woothemes.com/products/simplicity/">Simplicity</a>, and the extensions are <a\ntitle="WooCommerce Local Pickup Plus" href="http://www.woothemes.com/products/local-pickup-plus/">WooCommerce Local Pickup Plus</a>, <a\ntitle="YITH WooCommerce Cart Messages" href="http://yithemes.com/docs-plugins/yith-woocommerce-cart-messages/">YITH WooCommerce Cart Messages</a>, <a\ntitle="Flat Rate per State/Country/Region" href="https://wordpress.org/plugins/flat-rate-per-countryregion-for-woocommerce/">Flat Rate per State/Country/Region</a></p><p>If you want to review the entire multilingual ready list of themes and plugins you are welcome to view it here:</p><ul><li><a\ntitle="Multilingual Ready Themes " href="https://wpml.org/documentation/theme-compatibility/">Multilingual Ready Themes</a></li><li><a\ntitle="Multilingual Ready Plugins " href="https://wpml.org/documentation/plugins-compatibility/">Multilingual Ready Plugins</a></li></ul><p>Also, if you&#8217;re a theme or a plugin author and you want to make it compatible with WPML, we welcome you and ready to help: You are welcome to contact us at <a\nhref="https://wpml.org/documentation/theme-compatibility/go-global-program/">go global program page</a>.</p><p>In order to expedite the process we strongly recommend that you test your theme or plugin with our <a\ntitle="Achieving WPML compatibility for your themes and plugins" href="https://wpml.org/documentation/support/achieving-wpml-compatibility-for-your-themes-and-plugins/">Achieving WPML compatibility for your themes and plugins</a>. It easily tests compatibility with WPML and helps you quickly make your theme or plugin <strong>Multilingual Ready</strong>.</p><div\nclass="feature"><h2 style="text-align: center">Simplicity</h2><p\nstyle="text-align: center"><a\nhref="http://www.woothemes.com/products/simplicity/"><img\nclass="aligncenter size-full wp-image-340493" src="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/09/simplicity.png" alt="ekho" width="590" height="300" /></a></p><blockquote><p> Simplicity is a business theme that is hugely customizable with a clean layout, featured home page slider, and custom post types for testimonials, portfolio items, mini-features and slides.</p></blockquote><p\nstyle="text-align: center"><a\nclass="button download-button vt-p" href="http://www.woothemes.com/products/simplicity/">Purchase Simplicity</a></p></div><div\nclass="feature"><h2 style="text-align: center">WooCommerce Local Pickup Plus</h2><p\nstyle="text-align: center"><a\nhref="http://www.woothemes.com/products/local-pickup-plus/"></a></p><blockquote><p>Let customers pick up products from specific locations.</p></blockquote><p\nstyle="text-align: center"><a\nclass="button download-button vt-p" href="http://www.woothemes.com/products/local-pickup-plus/" target="_blank">Purchase WooCommerce Local Pickup Plus</a></p></div><div\nclass="feature"><h2 style="text-align: center">YITH WooCommerce Cart Messages</h2><p\nstyle="text-align: center"><a\nhref="http://yithemes.com/docs-plugins/yith-woocommerce-cart-messages/"></a></p><blockquote><p>Add promotional text to your WooCommerce cart</p></blockquote><p\nstyle="text-align: center"><a\nclass="button download-button vt-p" href="http://yithemes.com/docs-plugins/yith-woocommerce-cart-messages/">Purchase YITH WooCommerce Cart Messages</a></p></div><div\nclass="feature"><h2 style="text-align: center">Flat Rate per State/Country/Region For WooCommerce</h2><p\nstyle="text-align: center"><a\nhref="https://wordpress.org/plugins/flat-rate-per-countryregion-for-woocommerce/"></a></p><blockquote><p>This plugin allows you to set a flat delivery rate per States, Countries or World Regions on WooCommerce.</p></blockquote><p\nstyle="text-align: center"><a\nclass="button download-button vt-p" href="https://wordpress.org/plugins/flat-rate-per-countryregion-for-woocommerce/">Download Flat Rate per State/Country/Region</a></p></div> <div class="feedflare">\n<a href="http://feeds.feedburner.com/~ff/wpml?a=xvt26nJeonY:oTBp7KmVloA:D7DqB2pKExk"><img src="http://feeds.feedburner.com/~ff/wpml?i=xvt26nJeonY:oTBp7KmVloA:D7DqB2pKExk" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/wpml?a=xvt26nJeonY:oTBp7KmVloA:gIN9vFwOqvQ"><img src="http://feeds.feedburner.com/~ff/wpml?i=xvt26nJeonY:oTBp7KmVloA:gIN9vFwOqvQ" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/wpml?a=xvt26nJeonY:oTBp7KmVloA:V_sGLiPBpWU"><img src="http://feeds.feedburner.com/~ff/wpml?i=xvt26nJeonY:oTBp7KmVloA:V_sGLiPBpWU" border="0"></img></a>\n</div><img src="http://feeds.feedburner.com/~r/wpml/~4/xvt26nJeonY" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:137:"https://wpml.org/2015/09/woocommerce-compatibility-simplicity-local-pickup-plus-yith-cart-messages-flat-rate-per-statecountryregion/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"0";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:42:"http://rssnamespace.org/feedburner/ext/1.0";a:1:{s:8:"origLink";a:1:{i:0;a:5:{s:4:"data";s:132:"https://wpml.org/2015/09/woocommerce-compatibility-simplicity-local-pickup-