(137, 593, 'components_0_content_right', '<h3 style="text-align: center;">Regnet Faller Utan Oss</h3>\r\n<img class="size-medium wp-image-607 aligncenter" src="http://www.sofiakarlsson.com/wp-content/uploads/2014/10/SK_regnet_faller_utan_oss-300x300.jpg" alt="Regnet faller utan oss" width="300" height="300" />\r\n<p lang="SV" style="text-align: center;">Spotify: <a title="Spotify" href="http://po.st/RegnetfallerSpotify" target="_blank">http://po.st/RegnetfallerSpotify</a>\r\niTunes: <a title="iTunes" href="http://po.st/RegnetfalleriTunes" target="_blank">http://po.st/RegnetfalleriTunes</a>\r\nCDON: <a title="CDON" href="http://po.st/RegnetfallerCDON" target="_blank">http://po.st/RegnetfallerCDON</a></p>\r\n\r\n<div lang="SV" style="text-align: center;"></div>\r\n<p style="text-align: center;"><strong>Förhandsboka CD här (och få ett signerat ex):</strong>\r\nCDON: <a href="http://po.st/skCDON" target="_blank" rel="nofollow nofollow">http://po.st/skCDON</a>\r\nBenga<span class="text_exposed_show">ns: <a href="http://po.st/skBengans" target="_blank" rel="nofollow nofollow">http://po.st/skBengans</a>\r\nGinza: <a href="http://po.st/skGinza" target="_blank" rel="nofollow nofollow">http://po.st/skGinza</a></span></p>\r\n<p style="text-align: center;">F<strong>örhandsboka vinyl här:</strong>\r\nCDON: <a href="http://l.facebook.com/l.php?u=http%3A%2F%2Fpo.st%2FSofiacdon&amp;h=QAQGlxsX3&amp;s=1" target="_blank" rel="nofollow nofollow">http://po.st/Sofiacdon</a>\r\nBengans: <a href="http://l.facebook.com/l.php?u=http%3A%2F%2Fpo.st%2FSofiabengans&amp;h=yAQG5rvGh&amp;s=1" target="_blank" rel="nofollow nofollow">http://po.st/Sofiabengans</a>\r\nGinza: <a href="http://l.facebook.com/l.php?u=http%3A%2F%2Fpo.st%2FSofiaginza&amp;h=aAQEeSbgV&amp;s=1" target="_blank" rel="nofollow nofollow">http://po.st/Sofiaginza</a></p>'),
