INSERT INTO `sw_comments` (`comment_ID`, `comment_post_ID`, `comment_author`, `comment_author_email`, `comment_author_url`, `comment_author_IP`, `comment_date`, `comment_date_gmt`, `comment_content`, `comment_karma`, `comment_approved`, `comment_agent`, `comment_type`, `comment_parent`, `user_id`) VALUES
(1, 1, 'Herr WordPress', '', 'https://wordpress.org/', '', '2014-10-16 12:59:47', '2014-10-16 12:59:47', 'Hej! Det här är en kommentar.\nGör så här om du vill radera en kommentar, logga in och visa kommentarerna till inlägget. Där kan du välja om du vill redigera eller radera dom.', 0, '1', '', '', 0, 0),
(2, 2, 'Yawaluk', 'j48hez55w0@hotmail.com', 'http://www.facebook.com/profile.php?id=100003468720296', '141.135.226.207', '2014-12-31 09:39:36', '2014-12-31 08:39:36', 'This is for Carolyn in Virginia.  We found 5 of those bicci bling chairs in the sivelr grey color (called mink)  with the diamond rhinestones in the back.  Two in tj Marx  in fla and 3 in ct.  We need at least ONE more to  complete set.  if you want to sell the one or if anyone has seen one anywhere please buy it or them and we will gladly pay you and pick up or pay for shipping. We checked most Marshall''s  on the drive to fl from ct but to no avail.  PLEASE please help!!! Thank you!!!    Patdkelly @cox.net', 0, '0', 'Mozilla/5.0 (Windows NT 6.1; WOW64; rv:33.0) Gecko/20100101 Firefox/33.0', '', 0, 0),
(3, 1, 'Rahul', 'yg8zsfekcs@outlook.com', 'http://www.facebook.com/profile.php?id=100003468864865', '62.210.78.179', '2014-12-31 10:58:55', '2014-12-31 09:58:55', 'skriver:Hej! Det he4r e4r en kommentar.Gf6r se5 he4r om du vill raedra en kommentar: logga in och visa kommentarerna till inle4gget. De4r kan du ve4lja om du vill redigera eller raedra dem.', 0, '0', 'Mozilla/5.0 (Windows NT 6.1; WOW64; rv:33.0) Gecko/20100101 Firefox/33.0', '', 0, 0),
(4, 1, 'Mili', 'xyq6x2td28@yahoo.com', 'http://www.facebook.com/profile.php?id=100003468781267', '77.236.200.39', '2014-12-31 12:34:59', '2014-12-31 11:34:59', 'I''m trying to put some csalsic album covers on t-shirts and some other merch to sell. I''m not sure how I would go about licensing the images   I''m thinking maybe the label owns the image rights? It would seem like a pain in the neck to try to contact each label and actually get through to someone who would be responsible for such things. I''m wondering if their is  an easier more efficient and standard way to go about this.  Thanks for any help you may be able to provide.', 0, '0', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/37.0.2062.124 Safari/537.36', '', 1, 0);
