(8402, '_transient_dash_4077549d03da2e451c8b5f002294ff51', '<div class="rss-widget"><ul><li><a class=''rsswidget'' href=''https://wordpress.org/news/2015/09/wordpress-4-3-1/''>WordPress 4.3.1 Security and Maintenance Release</a> <span class="rss-date">15 september, 2015</span><div class="rssSummary">WordPress 4.3.1 is now available. This is a security release for all previous versions and we strongly encourage you to update your sites immediately. This release addresses three issues, including two cross-site scripting vulnerabilities and a potential privilege escalation. WordPress versions 4.3 and earlier are vulnerable to a cross-site scripting vulnerability when processing shortcode tags (CVE-2015-5714). Reported by [&hellip;]</div></li></ul></div><div class="rss-widget"><ul><li><a class=''rsswidget'' href=''http://wptavern.com/what-do-you-want-to-see-in-a-wordpress-tv-redesign''>WPTavern: What Do You Want to See in a WordPress.tv Redesign?</a></li><li><a class=''rsswidget'' href=''http://ma.tt/2015/10/hr-meets-science/''>Matt: HR Meets Science</a></li><li><a class=''rsswidget'' href=''http://ma.tt/2015/10/super-impressive-mario/''>Matt: Super Impressive Mario</a></li></ul></div><div class="rss-widget"><ul><li class=''dashboard-news-plugin''><span>Populärt tillägg:</span> <a href=''https://wordpress.org/plugins/google-analytics-dashboard-for-wp/'' class=''dashboard-news-plugin-link''>Google Analytics Dashboard for WP</a>&nbsp;<span>(<a href=''plugin-install.php?tab=plugin-information&amp;plugin=google-analytics-dashboard-for-wp&amp;_wpnonce=a3723eca8f&amp;TB_iframe=true&amp;width=600&amp;height=800'' class=''thickbox'' title=''Google Analytics Dashboard for WP''>Installera</a>)</span></li></ul></div>', 'no'),
