(1, 1, '2014-10-16 12:59:47', '2014-10-16 12:59:47', 'Välkommen till WordPress. Det här är ditt första inlägg. Redigera det eller radera det. Sedan kan du börja blogga!', 'Hej världen!', '', 'publish', 'open', 'open', '', 'hej-varlden', '', '', '2014-10-16 12:59:47', '2014-10-16 12:59:47', '', 0, 'http://sallywiola.se/?p=1', 0, 'post', '', 1),
(2, 1, '2014-10-16 12:59:47', '2014-10-16 12:59:47', 'Detta är en exempelsida. Den skiljer sig från ett blogginlägg eftersom den är statisk och kommer att finnas på samma plats hela tiden, den kommer troligen att visas i din sidnavigering (i de flesta teman). De flesta börjar med en Om-sida som introducerar dem för potentiella besökare. Den skulle t.ex kunna ha följande innehåll: \n\n<blockquote> Hej där! Jag är cykelbud på dagen, blivande skådespelare på natten och detta är min blogg. Jag bor i Örebro, har en katt som heter Lurv och jag gillar mitt morgonkaffe (och att simma i Göta kanal).</blockquote>\n\n... eller något liknande detta:\n\n<blockquote>Den officiella svenska portalen för WordPress, WordPress Sverige grundades 2007 och tillhandahåller svenska översättningar för WordPress, teman och tillägg. Behöver man hjälp med att komma igång eller stöter på problem så är WordPress Sverige den perfekta platsen att få svensk support på. Du hittar portalen på wpsv.se.</blockquote>\n\nSom ny WordPress-användare bör du gå till <a href="http://sallywiola.se/wp-admin/">din adminpanel</a> för att ta bort denna sida och sedan skapa nya sidor för ditt innehåll. Ha det så kul!', 'Exempelsida', '', 'publish', 'open', 'open', '', 'exempelsida', '', '', '2014-10-16 12:59:47', '2014-10-16 12:59:47', '', 0, 'http://sallywiola.se/?page_id=2', 0, 'page', '', 0),
